// components/About.js
import React from 'react';

const About = () => {
  return (
    <section className="about">
      <h2>About Us</h2>
      <p>
        We are a company dedicated to providing the best household appliances for your needs. 
        Our goal is to offer products that are reliable, innovative, and affordable, all while providing excellent customer service.
      </p>
    </section>
  );
};

export default About;
